INSERT INTO `language_source` VALUES (36296, 'app', 'Enter the Operator’s Billing information here: <br/>\nOperator’s Official Address:<br/>\nOperator’s Telephone Nbr. (Finance/Billing):<br/>\nOperator’s Email (Finance/Billing):<br/><br/>\n\nExample:<br/>\n100 International Road ABC Airline Building Postal Code<br/>\nTel: +8562051234567<br/>\nEmail: finance@abcairlines.com <br/><br/>\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN AS EXAMPLES\n');
INSERT INTO `language_source` VALUES (36297, 'app', 'Enter the Operator’s Billing information here;\nOperator’s Official Address:\nOperator’s Telephone Nbr. (Finance/Billing):\nOperator’s Email (Finance/Billing):\n\nExample:\n100 International Road ABC Airline Building Postal Code\nTel: +8562051234567\nEmail: finance@abcairlines.com\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN AS EXAMPLES\n');
INSERT INTO `language_source` VALUES (36298, 'app', 'For all SCHEDULED or SCHEDULED CHARTER flights, enter REGISTRATION MARKS (as indicated on its Certificate of Registration) of aircraft(s) to be used for each flight. Leave a space “_” between REGISTRATION MARKS. If substitutes are available but cannot be determined at the time of this application, leave a “_” and “OR SUBS”.<br/><br/>\n\n<b><span style=\'color:red\'><u>Example:</u><br/>\n9X-12345 9X-54321 9X-98765 9X-56789 OR SUBS</span></b><br/><br/>\n\nFor other PURPOSE OF FLIGHT, enter REGISTRATION MARK(s) of the aircraft and (or) its substitutes (if available) for that particular flight applied for, using the same format. <br/><br/>\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN AS EXAMPLES\n');
INSERT INTO `language_source` VALUES (36299, 'app', 'For all SCHEDULED or SCHEDULED CHARTER flights, enter REGISTRATION MARKS (as indicated on its Certificate of Registration) of aircraft(s) to be used for each flight. Leave a space “_” between REGISTRATION MARKS. If substitutes are available but cannot be determined at the time of this application, leave a “_” and “OR SUBS”.\n\nExample:\n9X-12345 9X-54321 9X-98765 9X-56789 OR SUBS\n\nFor other PURPOSE OF FLIGHT, enter REGISTRATION MARK(s) of the aircraft and (or) its substitutes (if available) for that particular flight applied for, using the same format.\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN AS EXAMPLES\n');
INSERT INTO `language_source` VALUES (36300, 'app', 'For all SCHEDULED or SCHEDULED CHARTER flights with multiple flights, leave a space “_” between each\n                    CALL SIGN/FLIGHT NUMBER.<br/><br/>\n                    \n                    Other “PURPOSE OF FLIGHT”, enter using the same format.<br/><br/>\n\n                    For OVER FLIGHT PERMISSION APPLICATIONS, each application is for ONE (1) FLIGHT only. One flight is\n                    equal to a Take-off (DEP AP)/Landing (ARR AP), traversing LAO FIR.<br/><br/>\n\n                    <b><span style=\'color:red\'><u>Format Example:</u><br/>\n                    INTAIR/IA123 INTERAIR/IA321 INTERAIR/IA789 INTERAIR/IA987</span></b><br/><br/>\n\n                    DO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT EXAMPLE SHOWN ABOVE. ANY OTHER\n                    CHARACTERS OR INFORMATION NOT REQUIRED SHALL NOT BE USED.');
INSERT INTO `language_source` VALUES (36301, 'app', 'For all SCHEDULED or SCHEDULED CHARTER flights with multiple flights, leave a space “_” between each CALL SIGN/FLIGHT NUMBER.\n                    \nOther “PURPOSE OF FLIGHT”, enter using the same format.\n\nFor OVER FLIGHT PERMISSION APPLICATIONS, each application is for ONE (1) FLIGHT only. One flight is\nequal to a Take-off (DEP AP)/Landing (ARR AP), traversing LAO FIR.\n\nFormat Example:\nINTAIR/IA123 INTERAIR/IA321 INTERAIR/IA789 INTERAIR/IA987\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT EXAMPLE SHOWN ABOVE. ANY OTHER\nCHARACTERS OR INFORMATION NOT REQUIRED SHALL NOT BE USED.');
INSERT INTO `language_source` VALUES (36302, 'app', 'Enter the 4 letter ICAO AIRCRAFT TYPE code and MTOW in Kilograms (KG). Use “/” and one thousand separator (,) to indicate an AIRCRAFT TYPE and its corresponding MTOW. Leave a space “_” between each AIRCRAFT TYPE/MTOW if substitute aircrafts are available.<br/>\n<br/>\n<b><span style=\'color:red\'><u>Example:</u><br/>\nA310/144,000 A312/164,000 A350/280,000 B778/247,200</span></b><br/><br/>\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN AS EXAMPLES');
INSERT INTO `language_source` VALUES (36303, 'app', 'Enter the 4 letter ICAO AIRCRAFT TYPE code and MTOW in Kilograms (KG). Use “/” and one thousand separator (,) to indicate an AIRCRAFT TYPE and its corresponding MTOW. Leave a space “_” between each AIRCRAFT TYPE/MTOW if substitute aircrafts are available.\n\nExample:\nA310/144,000 A312/164,000 A350/280,000 B778/247,200\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN AS EXAMPLES');
INSERT INTO `language_source` VALUES (36304, 'app', 'Enter the aircraft’s onboard RADIO EQUIPMENT as shown in the example below. Leave a space “_” between each equipment type.<br/><br/>\n<b><span style=\'color:red\'><u>Example:</u><br/>\nATC RTF SATCOM PBN RVSM VHF</span></b><br/><br/>\n\nIf unsure, enter<br/>\n<b><span style=\'color:red\'>ATC RTF SATCOM PBN RVSM VHF</span></b><br/><br/>\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN IN THE EXAMPLES');
INSERT INTO `language_source` VALUES (36305, 'app', 'Enter the aircraft’s onboard RADIO EQUIPMENT as shown in the example below. Leave a space “_” between each equipment type.\n\nExample:\nATC RTF SATCOM PBN RVSM VHF\n\nIf unsure, enter\nSTD ATC FREQ VHF HF COMM\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN IN THE EXAMPLES');
INSERT INTO `language_source` VALUES (36306, 'app', 'For SCHEDULED and CHARTER flights, please select the “START DATE” and the “END DATE” to indicate the block period of your schedule flight. Each permit application is for one block period only.');
INSERT INTO `language_source` VALUES (36307, 'app', 'For all SCHEDULED or SCHEDULED CHARTER flights, enter the SCHEDULE as follow;<br/>\n                    FLIGHT NUMBER_OPERATING DAY(S) OF THE WEEK_ETD_DEPARTURE AIRPORT ICAO<br/>\n                    CODE_HHMM UTC_ETA_DESTINATION AIRPORT ICAO CODE_HHMM UTC.<br/><br/>\n\n                    <span style=color:red><b><u>Format Example:</u><br/>\n                    IA123 1,2,3,4,5,6,7 ETD CITY 2359Z ETA CITY 0159Z+1<br/>\n                    IA321 1,2,3,4,5,6,7 ETD CITY 0259Z ETA CITY 0459Z</b></span><br/><br/>\n                    \n                    One application is for ONE (1) BLOCK SCHEDULE ONLY<br/><br/>\n\n                    For other PURPOSE OF FLIGHT (including NON-SCHEDULED CHARTER), enter the flight SCHEDULE as follow;<br/>\n                    FLIGHT NUMBER_ETD_DDMMYYYY_DEPARTURE AIRPORT ICAO CODE_HHMM<br/>\n                    UTC_ETA_DESTINATION AIRPORT ICAO CODE_HHMM UTC.<br/><br/>\n\n                    <span style=color:red><b><u>Format Example:</u><br/>\n                    IA123 ETD 01012020 CITY 2359Z ETA CITY 0159Z+1</b></span><br/><br/>\n\n                    For OVER FLIGHT PERMISSION APPLICATIONS, each application is for ONE (1) FLIGHT only. One flight is<br/>\n                    equal to a Take-off (DEP AP)/Landing (ARR AP), traversing LAO FIR.<br/><br/>\n                    One Arrival and Take-off from/to and vice versa into any Airport within LAO PDR for LANDING<br/>\n                    PERMISSION APPLICATION should indicate TWO flights.<br/>\n                    DO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT EXAMPLE SHOWN ABOVE.<br/>\n                    ANY OTHER CHARACTERS OR INFORMATION NOT REQUIRED SHALL NOT BE USED.');
INSERT INTO `language_source` VALUES (36308, 'app', 'For all SCHEDULED or SCHEDULED CHARTER flights, enter the SCHEDULE as follow;\nFLIGHT NUMBER_OPERATING DAY(S) OF THE WEEK_ETD_DEPARTURE AIRPORT ICAO\nCODE_HHMM UTC_ETA_DESTINATION AIRPORT ICAO CODE_HHMM UTC.\n\nFormat Example:\nIA123 1,2,3,4,5,6,7 ETD CITY 2359Z ETA CITY 0159Z+1\nIA321 1,2,3,4,5,6,7 ETD CITY 0259Z ETA CITY 0459Z\n                    \nOne application is for ONE (1) BLOCK SCHEDULE ONLY\n\nFor other PURPOSE OF FLIGHT (including NON-SCHEDULED CHARTER), enter the flight SCHEDULE as follow;\nFLIGHT NUMBER_ETD_DDMMYYYY_DEPARTURE AIRPORT ICAO CODE_HHMM\nUTC_ETA_DDMMYYYY_DESTINATION AIRPORT ICAO CODE_HHMM UTC.\n\nFormat Example:\nIA123 ETD 01012020 CITY 2359Z ETA CITY 0159Z+1\n\nFor OVER FLIGHT PERMISSION APPLICATIONS, each application is for ONE (1) FLIGHT only. One flight is\nequal to a Take-off (DEP AP)/Landing (ARR AP), traversing LAO FIR.\nOne Arrival and Take-off from/to and vice versa into any Airport within LAO PDR for LANDING\nPERMISSION APPLICATION should indicate TWO flights.\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT EXAMPLE SHOWN ABOVE.\nANY OTHER CHARACTERS OR INFORMATION NOT REQUIRED SHALL NOT BE USED.');
INSERT INTO `language_source` VALUES (36309, 'app', 'For all SCHEDULED or SCHEDULED CHARTER flights, enter the SCHEDULE as follow;\nFLIGHT NUMBER_OPERATING DAY(S) OF THE WEEK_ETD_DEPARTURE AIRPORT ICAO\nCODE_HHMM UTC_ETA_DESTINATION AIRPORT ICAO CODE_HHMM UTC.\n\nFormat Example:\nIA123 1,2,3,4,5,6,7 ETD CITY 2359Z ETA CITY 0159Z+1\nIA321 1,2,3,4,5,6,7 ETD CITY 0259Z ETA CITY 0459Z\n                    \nOne application is for ONE (1) BLOCK SCHEDULE ONLY\n\nFor other PURPOSE OF FLIGHT (including NON-SCHEDULED CHARTER), enter the flight SCHEDULE as follow;\nFLIGHT NUMBER_ETD_DDMMYYYY_DEPARTURE AIRPORT ICAO CODE_HHMM\nUTC_ETA_DESTINATION AIRPORT ICAO CODE_HHMM UTC.\n\nFormat Example:\nIA123 ETD 01012020 CITY 2359Z ETA CITY 0159Z+1\n\nFor OVER FLIGHT PERMISSION APPLICATIONS, each application is for ONE (1) FLIGHT only. One flight is\nequal to a Take-off (DEP AP)/Landing (ARR AP), traversing LAO FIR.\nOne Arrival and Take-off from/to and vice versa into any Airport within LAO PDR for LANDING\nPERMISSION APPLICATION should indicate TWO flights.\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT EXAMPLE SHOWN ABOVE.\nANY OTHER CHARACTERS OR INFORMATION NOT REQUIRED SHALL NOT BE USED.');
INSERT INTO `language_source` VALUES (36310, 'app', 'The minimum number of flights applied for all SCHEDULED\n(charter, passenger or cargo) applications should be more than 2\nper week over a period of at least 15 days. If not, please select\nother “PURPOSE OF FLIGHTS”.');
INSERT INTO `language_source` VALUES (36311, 'app', 'For all SCHEDULED and SCHEDULED CHARTER flights, enter the ROUTING for each CALL SIGN/FLIGHT<br/>\n                NUMBER. Leave a space “_” between airways, waypoints, STAR and SID.<br/><br/>\n\n                For OVER FLIGHT PERMISSION APPLICATION, a ROUTING for each CALL SIGN/FLIGHT NUMBER is equal to\n                a Take-off (DEP AP)/Landing (ARR AP), traversing LAO FIR.<br/><br/>\n\n                If flights have similar ROUTING or if you are unsure, enter “VIA APV ATS RTE”.<br/><br/>\n\n                <b style=\'color:red\'><u>Format Example:</u><br/>\n                IA123 CITY SID WAYPOINT AIRWAY STAR CITY<br/>\n                IA321 CITY SID WAYPOINTS AIRWAY STAR CITY</b><br/>\n                or <b style=\'color:red\'>VIA APV ATS RTE</b><br/><br/>\n\n                For other PURPOSE OF FLIGHT, enter the ROUTING using the same format.<br/><br/>\n\n                For OVER FLIGHT PERMIT APPLICATIONS, one flight is equal to a Take-off (DEP AP)/Landing (ARR AP),\n                traversing LAO FIR. Each application is for ONE flight only.<br/><br/>\n\n                For LANDING PERMISSION APPLICATION, an Arrival and subsequent Departure information from/to any\n                Airport within LAO PDR must be provided.<br/><br/>\n\n                DO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT EXAMPLE SHOWN ABOVE. ANY OTHER\n                CHARACTERS OR INFORMATION NOT REQUIRED SHALL NOT BE USED.');
INSERT INTO `language_source` VALUES (36312, 'app', 'For all SCHEDULED and SCHEDULED CHARTER flights, enter the ROUTING for each CALL SIGN/FLIGHT\nNUMBER. Leave a space “_” between airways, waypoints, STAR and SID.\n\nFor OVER FLIGHT PERMISSION APPLICATION, a ROUTING for each CALL SIGN/FLIGHT NUMBER is equal to\na Take-off (DEP AP)/Landing (ARR AP), traversing LAO FIR.\n\nIf flights have similar ROUTING or if you are unsure, enter “VIA APV ATS RTE”.\n\nFormat Example:\nIA123 CITY SID WAYPOINT AIRWAY STAR CITY\nIA321 CITY SID WAYPOINTS AIRWAY STAR CITY\nor VIA APV ATS RTE\n\nFor other PURPOSE OF FLIGHT, enter the ROUTING using the same format.\n\nFor OVER FLIGHT PERMIT APPLICATIONS, one flight is equal to a Take-off (DEP AP)/Landing (ARR AP),\ntraversing LAO FIR. Each application is for ONE flight only.\n\nFor LANDING PERMISSION APPLICATION, an Arrival and subsequent Departure information from/to any\nAirport within LAO PDR must be provided.\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT EXAMPLE SHOWN ABOVE. ANY OTHER\nCHARACTERS OR INFORMATION NOT REQUIRED SHALL NOT BE USED.');
INSERT INTO `language_source` VALUES (36313, 'app', 'The list of documents required are;<br/>\n1. Air Operator Certificate/ Ops Specs,<br/>\n2. Certificate of Registration (allow “+” is more than two aircrafts used for the flight)<br/>\n3. Certificate of Airworthiness,<br/>\n4. License of each crew members (allow “+” for multiple crew),<br/>\n5. Noise Certificate,<br/>\n6. Aircraft Radio Station License,<br/>\n7. Certificate of Insurance.\n');
