INSERT INTO `language_source` VALUES (36326, 'app', 'For all SCHEDULED or SCHEDULED CHARTER flights, enter REGISTRATION MARKS (as indicated on its Certificate of Registration) of aircraft(s) to be used for each flight. Leave a space “_” between REGISTRATION MARKS. If substitutes are available but cannot be determined at the time of this application, leave a “_” and “OR SUBS”.<br/><br/>\n\nExample:<br/>\n9X-12345 9X-54321 9X-98765 9X-56789 OR SUBS<br/><br/>\n\nFor other PURPOSE OF FLIGHT, enter REGISTRATION MARK(s) of the aircraft and (or) its substitutes (if available) for that particular flight applied for, using the same format. <br/><br/>\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN AS EXAMPLES\n');
INSERT INTO `language_source` VALUES (36327, 'app', 'For all SCHEDULED or SCHEDULED CHARTER flights with multiple flights, leave a space “_” between each CALL SIGN/FLIGHT NUMBER. <br/><br/>\n\nIf both CALL SIGN/FLIGHT NUMBER are the same, enter only once.<br/><br/>\n\nOther “PURPOSE OF FLIGHT” to enter using the same format. Each application is for one flight only”. One flight is equal to a take-off landing or to and fro over LAO FIR for OVER FLIGHT PERMIT APPLICATIONS. <br/><br/>\n\nExample:<br/>\nINTAIR/IA123 INTERAIR/IA321 INTERAIR/IA789 INTERAIR/IA987 or<br/>\nIA123 IA321 IA789 IA987<br/><br/>\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN AS EXAMPLES');
INSERT INTO `language_source` VALUES (36328, 'app', 'For all SCHEDULED or SCHEDULED CHARTER flights with multiple flights, leave a space “_” between each CALL SIGN/FLIGHT NUMBER.\n\nIf both CALL SIGN/FLIGHT NUMBER are the same, enter only once.\n\nOther “PURPOSE OF FLIGHT” to enter using the same format. Each application is for one flight only”. One flight is equal to a take-off landing or to and fro over LAO FIR for OVER FLIGHT PERMIT APPLICATIONS.\n\nExample:\nINTAIR/IA123 INTERAIR/IA321 INTERAIR/IA789 INTERAIR/IA987 or\nIA123 IA321 IA789 IA987\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN AS EXAMPLES');
INSERT INTO `language_source` VALUES (36329, 'app', 'Enter the 4 letter ICAO AIRCRAFT TYPE code and MTOW in Kilograms (KG). Use “/” and one thousand separator (,) to indicate an AIRCRAFT TYPE and its corresponding MTOW. Leave a space “_” between each AIRCRAFT TYPE/MTOW if substitute aircrafts are available.<br/>\n<br/>\nExample:<br/>\nA310/144,000 A312/164,000 A350/280,000 B778/247,200<br/><br/>\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN AS EXAMPLES');
INSERT INTO `language_source` VALUES (36330, 'app', 'Enter the aircraft’s onboard RADIO EQUIPMENT as shown in the example below. Leave a space “_” between each equipment type.<br/><br/>\n\nExample:<br/>\nATC RTF SATCOM PBN RVSM VHF<br/><br/>\n\nIf unsure, enter<br/>\nSTD ATC FREQ VHF HF COMM <br/><br/>\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN IN THE EXAMPLES');
INSERT INTO `language_source` VALUES (36331, 'app', 'For all SCHEDULED or SCHEDULED CHARTER flights, enter the flight SCHEDULE as follow;<br/> FLIGHT NUMBER_OPERATING DAY(S) OF THE WEEK_ETD_DEPARTURE AIRPORT ICAO CODE_HHMM UTC_ETA_DESTINATION AIRPORT ICAO CODE_HHMM UTC.<br/><br/>\n\nExample:<br/>\nIA123 1,2,3,4,5,6,7 ETD VTBS 2359Z ETA VVNB 0159Z+1<br/>\nIA321 1,2,3,4,5,6,7 ETD VVNB 0259Z ETA VTBS 0459Z<br/><br/>\n\nEach application is for ONE block schedule only.<br/><br/>\n\nFor other PURPOSE OF FLIGHT, enter the flight SCHEDULE as follow;<br/>\nFLIGHT NUMBER_ETD_DOF/DDMMYY_DEPARTURE AIRPORT ICAO CODE_HHMM UTC_ETA_DOF/DDMMYY_DESTINATION AIRPORT ICAO CODE_HHMM UTC.<br/><br/>\n\nExample:<br/>\nPV100 ETD 010119 VTBS 2359Z ETA VVNB 0159Z +1<br/><br/>\n\nEach application is for ONE flight only. One flight is equal to a take-off from a departure airport and landing in an arrival airport whose routing passes over LAO FIR for OVER FLIGHT PERMIT APPLICATIONS.<br/><br/>\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN IN EXAMPLES\n');
INSERT INTO `language_source` VALUES (36332, 'app', 'For all SCHEDULED or SCHEDULED CHARTER flights, enter the flight SCHEDULE as follow;\nFLIGHT NUMBER_OPERATING DAY(S) OF THE WEEK_ETD_DEPARTURE AIRPORT ICAO CODE_HHMM UTC_ETA_DESTINATION AIRPORT ICAO CODE_HHMM UTC.\n\nExample:\nIA123 1,2,3,4,5,6,7 ETD VTBS 2359Z ETA VVNB 0159Z+1\nIA321 1,2,3,4,5,6,7 ETD VVNB 0259Z ETA VTBS 0459Z\n\nEach application is for ONE block schedule only.\n\nFor other PURPOSE OF FLIGHT, enter the flight SCHEDULE as follow;\nFLIGHT NUMBER_ETD_DOF/DDMMYY_DEPARTURE AIRPORT ICAO CODE_HHMM UTC_ETA_DOF/DDMMYY_DESTINATION AIRPORT ICAO CODE_HHMM UTC.\n\nExample:\nPV100 ETD 010119 VTBS 2359Z ETA VVNB 0159Z +1\n\nEach application is for ONE flight only. One flight is equal to a take-off from a departure airport and landing in an arrival airport whose routing passes over LAO FIR for OVER FLIGHT PERMIT APPLICATIONS.\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN IN EXAMPLES\n');
INSERT INTO `language_source` VALUES (36333, 'app', 'For all SCHEDULED or SCHEDULED CHARTER flights, enter the flight SCHEDULE as follow;<br/>\nFLIGHT NUMBER_OPERATING DAY(S) OF THE WEEK_ETD_DEPARTURE AIRPORT ICAO CODE_HHMM UTC_ETA_DESTINATION AIRPORT ICAO CODE_HHMM UTC.<br/><br/>\n\nOne application is for ONE block schedule only.<br/><br/>\n\nExample:<br/>\nIA123 1,2,3,4,5,6,7 ETD VTBS 2359Z ETA VLVT 0059Z+1<br/>\nIA321 1,2,3,4,5,6,7 ETD VLVT 0159Z ETA VTBS 0259Z<br/><br/>\n\nFor other PURPOSE OF FLIGHT, enter the flight SCHEDULE as follow;<br/>\nFLIGHT NUMBER_ETD_DOF/DDMMYY_DEPARTURE AIRPORT ICAO CODE_HHMM UTC_ETA_DOF/DDMMYY_DESTINATION AIRPORT ICAO CODE_HHMM UTC.<br/><br/>\n\nApplication is for ONE flight only. This is equal to a take-off from a departure airport and landing in an arrival airport (in LAO PDR). Vice versa.<br/><br/>\n\nExample:<br/>\nPV100 ETD 010119 VTBS 2359Z ETA VLVT 0059Z +1<br/>\nPV101 ETD 020119 VLVT 0159Z ETA VTBS 0259Z<br/><br/>\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN IN EXAMPLES\n');
INSERT INTO `language_source` VALUES (36334, 'app', 'For all SCHEDULED or SCHEDULED CHARTER flights, enter the flight SCHEDULE as follow;\nFLIGHT NUMBER_OPERATING DAY(S) OF THE WEEK_ETD_DEPARTURE AIRPORT ICAO CODE_HHMM UTC_ETA_DESTINATION AIRPORT ICAO CODE_HHMM UTC.\n\nOne application is for ONE block schedule only.\n\nExample:\nIA123 1,2,3,4,5,6,7 ETD VTBS 2359Z ETA VLVT 0059Z+1\nIA321 1,2,3,4,5,6,7 ETD VLVT 0159Z ETA VTBS 0259Z\n\nFor other PURPOSE OF FLIGHT, enter the flight SCHEDULE as follow;\nFLIGHT NUMBER_ETD_DOF/DDMMYY_DEPARTURE AIRPORT ICAO CODE_HHMM UTC_ETA_DOF/DDMMYY_DESTINATION AIRPORT ICAO CODE_HHMM UTC.\n\nApplication is for ONE flight only. This is equal to a take-off from a departure airport and landing in an arrival airport (in LAO PDR). Vice versa.\n\nExample:\nPV100 ETD 010119 VTBS 2359Z ETA VLVT 0059Z +1\nPV101 ETD 020119 VLVT 0159Z ETA VTBS 0259Z\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE FORMAT SHOWN IN EXAMPLES\n\n');
INSERT INTO `language_source` VALUES (36335, 'app', 'For all SCHEDULED and SCHEDULED CHARTER flights, enter the FLIGHT NUMBER and it’s corresponding ROUTING over Lao FIR. Leave a space “_” between airways, waypoints, entry or exit routes. One FLIGHT NUMBER and its ROUTING on one line.<br/><br/>\n\nIf ROUTING is not established at time of application, enter “VIA APV ATS RTE”<br/><br/>\n\nExample:<br/>\nTT123 VTBD DONNA R474 NAKHA TEBAK XEREN ZGNN<br/>\nTT321 ZGNN XEREN NAKHA Q3 DADIN N639 VILAO B329 VDPP or<br/><br/>\n\nTT123 VIA APV ATS RTE<br/><br/>\n\nOther PURPOSE OF FLIGHT, enter the ROUTING using the same format. Each application is for ONE OVER FLIGHT ONLY within Lao FIR. This is equal to a take-off from a departure airport and landing in an arrival airport.<br/><br/>\n\nExample:<br/>\nPB123 VTBD DONNA R474 NAKHA TEBAK XEREN ZGNN or<br/><br/>\n\nPB123 VIA APV ATS RTE<br/><br/>\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE EXAMPLES SHOWN.\n');
INSERT INTO `language_source` VALUES (36336, 'app', 'For all SCHEDULED and SCHEDULED CHARTER flights, enter the FLIGHT NUMBER and it’s corresponding ROUTING over Lao FIR. Leave a space “_” between airways, waypoints, entry or exit routes. One FLIGHT NUMBER and its ROUTING on one line.\n\nIf ROUTING is not established at time of application, enter “VIA APV ATS RTE”\n\nExample:\nTT123 VTBD DONNA R474 NAKHA TEBAK XEREN ZGNN\nTT321 ZGNN XEREN NAKHA Q3 DADIN N639 VILAO B329 VDPP or\n\nTT123 VIA APV ATS RTE\n\nOther PURPOSE OF FLIGHT, enter the ROUTING using the same format. Each application is for ONE OVER FLIGHT ONLY within Lao FIR. This is equal to a take-off from a departure airport and landing in an arrival airport.\n\nExample:\nPB123 VTBD DONNA R474 NAKHA TEBAK XEREN ZGNN or\n\nPB123 VIA APV ATS RTE\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE EXAMPLES SHOWN.\n');
INSERT INTO `language_source` VALUES (36337, 'app', 'For all SCHEDULED and SCHEDULED CHARTER flights, enter the ROUTING for each FLIGHT NUMBER. Leave a space “_” between airways, waypoints, entry or exit routes.<br/> <br/>\n\nOne ROUTING is equal to a take-off from a departure airport and landing into an arrival airport within Lao FIR. Vice versa.<br/><br/>\n\nIf ROUTING is not established at time of application, enter “VIA APV ATS RTE”<br/><br/>\n\nExample:<br/>\nTT123 WSSS REDUK R325 TAMOS A464 POLAK DONNA R474 VLVT<br/>\nTT321 VLVT XEREN NAKHA Q3 DADIN N639 VILAO B329 VDPP or <br/><br/>\n\nTT123 VIA APV ATS RTE<br/><br/>\n\nOther PURPOSE OF FLIGHT, enter the ROUTING using the same format. Each application is for ONE RETURN FLIGHT ONLY. <br/><br/>\n\nThis is equal to a take-off from a departure airport, landing in an arrival airport within Lao FIR. Vice versa.<br/><br/>\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE EXAMPLES SHOWN.\n');
INSERT INTO `language_source` VALUES (36338, 'app', 'For all SCHEDULED and SCHEDULED CHARTER flights, enter the ROUTING for each FLIGHT NUMBER. Leave a space “_” between airways, waypoints, entry or exit routes.\n\nOne ROUTING is equal to a take-off from a departure airport and landing into an arrival airport within Lao FIR. Vice versa.\n\nIf ROUTING is not established at time of application, enter “VIA APV ATS RTE”\n\nExample:\nTT123 WSSS REDUK R325 TAMOS A464 POLAK DONNA R474 VLVT\nTT321 VLVT XEREN NAKHA Q3 DADIN N639 VILAO B329 VDPP or\n\nTT123 VIA APV ATS RTE\n\nOther PURPOSE OF FLIGHT, enter the ROUTING using the same format. Each application is for ONE RETURN FLIGHT ONLY.\n\nThis is equal to a take-off from a departure airport, landing in an arrival airport within Lao FIR. Vice versa.\n\nDO NOT ENTER ANY OTHER INFORMATION BESIDES THE EXAMPLES SHOWN.\n');
